import React from 'react'
import styled from 'styled-components/macro';

const DropdownConainer = styled.div`
    position: fixed;
    z-index: 999;
    width: 100%;
    height: 100%;
    background: green;
    display: grid;
    align-items: center;
    top: 0;
    left: 0;
    transition: 0.3s ease-in-out ;
    opacity: 1;
    top: 0;



`;
const Dropdown = () => {
    return (
        <DropdownConainer>
            <Icon></Icon>
        </DropdownConainer>

    )
}

export default Dropdown
